import React from 'react'
import Album from '../components/Album'
import '../App.css';

export default function AlbumContainer({ albums }) {

    const showAlbums = () => {
        return albums.map( album => {
            console.log(album)
            return <Album key={album.id} {...album}/>
        })
    }

    return (
        <div className="album-container">
            {showAlbums()}
        </div>
    )
}
